    Input: lst: a list of two strings
    Output: result: a string ('Yes' or 'No')
    '''
    stack = []
    for s in lst:
        for char in s:
            if char == '(':
                stack.append(char)
            elif char == ')':
                if stack and stack[-1] == '(':
                    stack.pop()
                else:
                    return 'No'
    return 'Yes' if not stack else 'No'

