def valid_date(date):
    # Split the date string into month, day, and year
    parts = date.split('-')
    # Check if the split date has exactly 3 parts
    if len(parts) != 3:
        return False
    month, day, year = parts
    # Try converting month, day, and year to integers
    try:
        month = int(month)
        day = int(day)
        year = int(year)
    except ValueError:
        return False
    # Check if month is valid
    if month < 1 or month > 12:
        return False
    # Check if day is valid for the given month
    if month in [1, 3, 5, 7, 8, 10, 12]:
        if day < 1 or day > 31:
            return False
    elif month in [4, 6, 9, 11]:
        if day < 1 or day > 30:
            return False
    elif month == 2:
        if day < 1 or day > 29:
            return False
    # Check if year is a valid year (not negative)
    if year < 0:
        return False
    # If all checks pass, the date is valid
    return True

