def minPath(grid, k):
    import heapq
    N = len(grid)
    start_val, start_pos = min((grid[i][j], (i, j)) for i in range(N) for j in range(N))
    pq = [(start_val, 0, start_pos)]
    visited = set()
    path = []

    while pq and len(path) < k:
        val, _, pos = heapq.heappop(pq)
        if pos in visited and len(path) == k - 1:
            continue
        visited.add(pos)
        path.append(val)
        if len(path) == k:
            break
        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            nx, ny = pos[0] + dx, pos[1] + dy
            if 0 <= nx < N and 0 <= ny < N:
                heapq.heappush(pq, (grid[nx][ny], len(visited), (nx, ny)))

    return path

def tri(n):
    if n == 0:
        return [3]
    tribonacci_seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            tribonacci_seq.append(1 + i / 2)
        else:
            if i + 1 <= n:
                tribonacci_seq.append(tribonacci_seq[i - 1] + tribonacci_seq[i - 2] + (1 + (i + 1) / 2))
            else:
                tribonacci_seq.append(tribonacci_seq[i - 1] + tribonacci_seq[i - 2] + tribonacci_seq[i - 3])
    return tribonacci_seq

def digits(n):
    """Given a positive integer n, return the product of the odd digits.
    Return 0 if all digits are even.
    """
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n = n // 10

    if not has_odd:
        return 0
    else:
        return product

def is_nested(string):
    stack = []
    for ch in string:
        if ch == '[':
            stack.append(ch)
        elif ch == ']':
            if not stack:
                return False
            stack.pop()
    return len(stack) > 0

