def cycpattern_check(a, b):
    """Check if b or any of its rotations is a substring in a."""
    n = len(a)
    m = len(b)
    if m > n:
        return False
    aa = a + a
    for i in range(n):
        sub = aa[i:i+m]
        if sub == b or b in sub:
            return True
    return False

